import React, { Component } from 'react';
import { useFormik } from 'formik';

class Splash extends Component {
	event_info = useFormik({
		initialValues: {
		event_name: '',
		creator: '',
		location: '',
	},
	onSubmit: values => {
	alert(JSON.stringify(values, null, 2));
	},
	});

  render() {
    return (
     <header className="App-header">
     <form onSubmit={event_info.handleSubmit}>
      <label htmlFor="event_name">Event Name</label>
      <input
        id="event_name"
        name="event_name"
        type="text"
        onChange={event_info.handleChange}
        value={event_info.values.event_name}
      />
      <label htmlFor="creator">Event Name</label>
      <input
        id="creator"
        name="creator"
        type="text"
        onChange={event_info.handleChange}
        value={event_info.values.event_name}
      />
      <label htmlFor="location">Event Name</label>
      <input
        id="location"
        name="location"
        type="text"
        onChange={event_info.handleChange}
        value={event_info.values.event_name}
      />
      </form>
      </header>
    );
	}
}

export default Splash;
